# Data Deletion
class DataDeleter:
    @staticmethod
    def delete_data_for_date(target_date: str) -> bool:
        try:
            if not DataValidator.validate_date_format(target_date):
                raise ValueError("Invalid date format. Expected YYYY-MM-DD.")
            # Simulate deletion
            print(f"Data for {target_date} has been deleted.")
            return True
        except Exception as e:
            print(f"Error during deletion: {e}")
            return False

# Date Validation
class DataValidator:
    @staticmethod
    def validate_date_format(date_str: str, fmt: str = "%Y-%m-%d") -> bool:
        try:
            datetime.strptime(date_str, fmt)
            return True
        except ValueError:
            return False

