# File Generation
class DFileGenerator:
    def generate_d_file(self, data: List[Dict]) -> str:
        filename = f"D_file_{datetime.now().strftime('%Y%m%d_%H%M%S')}.csv"
        with open(filename, 'w') as f:
            writer = csv.DictWriter(f, fieldnames=data[0].keys())
            writer.writeheader()
            writer.writerows(data)
        print(f"Generated D file: {filename}")
        return filename

